INSERT INTO `institution` VALUES (1,NULL,26964,NULL,'Центр сучасної естетичної стоматології NEW SMILE','tsentr-suchasno-estetichno-stomatolog-new-smile','43859151',NULL,'state',1,12333,'2023-12-13 15:48:56','2023-12-13 15:48:56'),(2,43,26334,NULL,'Хмельницька міська поліклініка №5','hmelnitska-mska-polklnka-5','42980032',NULL,'state',1,12334,'2023-12-13 15:49:00','2023-12-13 15:49:00'),(3,NULL,13496,NULL,'Медичний центр ТзОВ Клініка репродукції людини \"Альтернатива\"','medichniy-tsentr-tzov-klnka-reprodukts-lyudini-alternativa','35968446','<p>Медичний центр ТзОВ Клініка репродукції людини &ldquo;Альтернатива&rdquo; успішно працює з 2009 року, проте наші фахівці володіють більш ніж 15-річним досвідом роботи в репродуктології.</p>\r\n\r\n<p>Засновник клініки Палига Ігор Євгенович одним з перших у Західній Україні почав займатися проблематикою всіх видів безпліддя та їх ефективним лікуванням.<br />\r\nУ нас&nbsp; кращі медичні традиції поєднані з найновішими світовими технологіями. Це дозволяє досягати&nbsp;до 86 % успішності лікування безпліддя.</p>\r\n\r\n<p>Зараз&nbsp;&nbsp;клініка &laquo;Альтернатива&raquo; приєдналася до мережі клінік Ovumia Group.&nbsp;Ovumia Group є однією з найбільш швидкозростаючих мереж клінік із лікування безпліддя в Європі. Всього в Ovumia Group входять 7 клінік репродуктивної медицини. Крім &laquo;Альтернативи&raquo;, в мережу входять клініки Фінляндії, Естонії та Швеції. Ovumia Group є провідною мережею клінік у Скандинавії, що спеціалізується на лікуванні безпліддя та відома своїм чудовим досвідом, наприклад, у інноваційних методах лікування безпліддя.</p>','private',1,12335,'2023-12-13 15:49:36','2023-12-13 15:49:36'),(4,52,864,NULL,'Бережанський обласний дитячий гастроентерологічний санаторій','berezhanskyi-oblasnyi-dytiachyi-hastroenterolohichnyi-sanatorii','11111111',NULL,'state',1,155833,'2023-12-13 15:49:36','2023-12-13 15:49:36'),(5,26,864,NULL,'Бережанська центральна районна  лікарня','berezhanska-tsentralna-raionna-likarnia','0